package collection;

import java.util.HashSet;
import java.util.Set;

public class Setexample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		Set<String> obj1= new HashSet<String>();
		
		obj1.add("Rose");
		obj1.add("Jasmine");
		obj1.add("Pink");
		obj1.add("Red");
		
		System.out.println(obj1);
		
	}

}
